import React from "react";
import { Stack, Text } from "@chakra-ui/core";

const Heading = ({ title, subtitle }) => {
  return (
    <Stack>
      <Text fontWeight="300" fontSize="lg">
        {title}
      </Text>
      <Text>{subtitle}</Text>
    </Stack>
  );
};

export default Heading;
